Create one autoconf target for each AC_DEFUN, in the same order as they appear in the M4 file . This makes it easier to compare the Bazel code with the original M4. Important convention: The target matching the package name (e.g., c32rtomb in the c32rtomb package) should: Have no checks (checks = [] or omitted) Have deps on all other targets in the same package Exclude *_DEFAULTS targets from deps This pattern separates the "what this module provides" (the package-named aggregator target) from "how it works" (the individual AC_DEFUN targets with checks). """https://github.com/coreutils/gnulib/blob/.../m4/c32rtomb.m4""" load("//autoconf:autoconf.bzl", "autoconf")
load("//autoconf:checks.bzl", "checks") # gl_FUNC_C32RTOMB - lines 10-56 (FIRST AC_DEFUN in M4)
autoconf( name = "gl_FUNC_C32RTOMB", checks = [ checks.AC_SUBST("HAVE_C32RTOMB", condition = "gl_cv_func_c32rtomb", ...), checks.AC_SUBST("REPLACE_C32RTOMB", ...), ], deps = [ "//autoconf/macros/AC_CANONICAL_HOST", "//gnulib/m4/mbrtoc32:gl_MBRTOC32_SANITYCHECK", ":gl_C32RTOMB_SANITYCHECK", ":gl_CHECK_FUNC_C32RTOMB", ],
) # gl_CHECK_FUNC_C32RTOMB - lines 59-92 (SECOND AC_DEFUN)
autoconf( name = "gl_CHECK_FUNC_C32RTOMB", checks = [ checks.AC_CHECK_DECL("c32rtomb", ...), checks.AC_TRY_LINK(name = "gl_cv_func_c32rtomb", ...), ],
) # gl_C32RTOMB_SANITYCHECK - lines 94-171 (THIRD AC_DEFUN)
autoconf( name = "gl_C32RTOMB_SANITYCHECK", checks = [ checks.AC_DEFINE("HAVE_WORKING_C32RTOMB", ...), checks.AC_SUBST("HAVE_WORKING_C32RTOMB", ...), ], deps = [ "//gnulib/m4/uchar_h", ":gl_CHECK_FUNC_C32RTOMB", ],
) # Package-level aggregator target (matches package name)
# No checks - just deps on all other targets (excluding *_DEFAULTS)
autoconf( name = "c32rtomb", visibility = ["//visibility:public"], deps = [ ":gl_FUNC_C32RTOMB", ":gl_CHECK_FUNC_C32RTOMB", ":gl_C32RTOMB_SANITYCHECK", ],
)

