Multiple M4 files often perform the same check (e.g., AC_CHECK_HEADERS_ONCE([utmp.h])) without having an AC_REQUIRE relationship between them. In Bazel, this would cause duplicate check errors. Solution: Create an isolated autoconf target that contains only the conflicting check, then add it as a dependency to both consumers. Do not remove modules from the duplicates test as a workaround. Example: utmp.h header check The utmp_h module checks for utmp.h: # utmp_h.m4
AC_DEFUN([gl_UTMP_H], [ AC_CHECK_HEADERS([utmp.h]) ...
]) The readutmp module also checks for utmp.h: # readutmp.m4
AC_DEFUN([gl_READUTMP], [ AC_CHECK_HEADERS_ONCE([utmp.h utmpx.h]) # Same check, no AC_REQUIRE! ...
]) There's no AC_REQUIRE([gl_UTMP_H]) in readutmp, but both need the same header check. Create a separate target for just the header check: # gnulib/m4/utmp_h/BUILD.bazel # Isolated header check - can be shared by multiple modules
autoconf( name = "HAVE_UTMP_H", checks = [ checks.AC_CHECK_HEADER("utmp.h", define = "HAVE_UTMP_H"), ], visibility = ["//visibility:public"],
) # Main utmp_h module
autoconf( name = "utmp_h", checks = [ # Other checks specific to utmp_h... ], deps = [ ":HAVE_UTMP_H", # Use the shared check ],
) # gnulib/m4/readutmp/BUILD.bazel autoconf( name = "readutmp", checks = [ # Other checks specific to readutmp... ], deps = [ "//gnulib/m4/utmp_h:HAVE_UTMP_H", # Use the same shared check ],
) Key principle: Keep the isolated check target in the most semantically relevant package (e.g., the header check for utmp.h lives in the utmp_h package), and have other modules depend on it.

