load("@rules_cc_autoconf//autoconf:checks.bzl", "checks") checks.AC_TRY_LINK(*, code, name, define, includes, language, compile_defines, requires, if_true, if_false, subst) Try to compile and link custom code. This function mirrors GNU Autoconf's AC_LINK_IFELSE macro, which uses AC_LANG_PROGRAM to construct test programs. In Bazel, use code (optionally with includes). For the AC_LANG_PROGRAM pattern, pass code = utils.AC_LANG_PROGRAM(prologue, body). Comparison with GNU Autoconf: GNU Autoconf: AC_LINK_IFELSE( [AC_LANG_PROGRAM( [[#include <stdio.h>]], # Prologue (includes/declarations) [[printf("test");]] # Body (code inside main()) )], [AC_DEFINE([HAVE_PRINTF], [1])], []
) Bazel (AC_LANG_PROGRAM pattern): load("//autoconf:checks.bzl", "utils")
checks.AC_TRY_LINK( code = utils.AC_LANG_PROGRAM(["#include <stdio.h>"], "printf("test");"), define = "HAVE_PRINTF",
) Bazel (includes pattern - backward compat): checks.AC_TRY_LINK( includes = ["stdio.h"], code = "printf("test");", # Treated as body of main() define = "HAVE_PRINTF",
) Bazel (raw code pattern): checks.AC_TRY_LINK( code = "#include <stdio.h>\nint main() { printf(\"test\"); return 0; }", define = "HAVE_PRINTF",
) Note: This is similar to AC_TRY_COMPILE but also links the code, which is necessary to verify that functions are available at link time (not just declared). PARAMETERS Name Description Default Value code Code to compile and link. If includes is also provided, this is treated as the body of main(). Otherwise, it should be complete C code. For AC_LANG_PROGRAM-style tests use code = utils.AC_LANG_PROGRAM(prologue, body). None name Cache variable name. None define Define name to set if compilation and linking succeeds None includes Optional list of headers to include (backward compatibility). When provided, code is treated as the body of main() function. None language Language to use for check ("c" or "cpp") "c" compile_defines Optional list of preprocessor define names from previous checks to add before includes (e.g., ["_GNU_SOURCE", "_DARWIN_C_SOURCE"]). Each string must match the define name of a previous check. The values from those checks will be used automatically. None requires Requirements that must be met for this check to run. Can be define names (e.g., "HAVE_FOO"), negated (e.g., "!HAVE_FOO"), or value-based (e.g., "REPLACE_FSTAT==1", "REPLACE_FSTAT!=0"). None if_true Value to use when check succeeds (currently not used for this check type). 1 if_false Value to use when check fails (currently not used for this check type). 0 subst If True, mark as a substitution variable (for @VAR@ replacement in subst.h). None RETURNS A JSON-encoded check string for use with the autoconf rule.

